import { Button, Tooltip } from 'antd';
import React from 'react'

import { DeleteOutlined } from "@ant-design/icons";
function RowDelete() {
  return (
    <>
          <Tooltip title="GÖRÜNTÜLE">
        <Button
          style={{ margin: "5px", background: "#009D7E" }}
          icon={<DeleteOutlined />}
        />
      </Tooltip>
      
    </>
  )
}

export default RowDelete;
